@EU_Commission @vonderleyen @eucopresident @EP_President @kmitsotakis @AndrejPlenkovic Can WE do something and try to solve this problem or are we, as EU, gonna pay 6 billion to Turkey and continue ignoring this problem??
Can we as Europe defends the rights of the Sirian people or are we gonna “turn your face”?
WE HAVE TO!

@EU_Commission @vonderleyen @eucopresident @EP_President @kmitsotakis @AndrejPlenkovic @MargSchinas @Frontex They have not been lured. They are trying to be safe.
We want leaders and EU to stand up for human rights.
We CANNOT tolerate what's happening now.
